y sheep. Just as the previous one, click it couple times to make it explode, which should result in getting an angry bleat '...' from Enraged Volatile Elwynn Sheep.",sourceQuests={43799}}),q(43658,{c=a[949],crs={111704},description="Now you need to go to the Tower of Azora in Elwynn Forest. Once there you will see Cote talking to Theocritus. After a short RP bit, he will become hostile and when you kill him, he drops the item.",maps={37},sourceQuests={43800},g={i(139558,{b=1,c=a[949],f=55,spellID=81040,g={artifact(846,{c=a[949]})}})}})}}),cl(8.063,{c=a[949],g={i(139559,{b=1,c=a[949],f=55,spellID=220690,g={artifact(893,{c=a[949]})}})}}),cl(8.064,{c=a[949],g={gt(386,{c=a[949],description="A set of 5 portals is generated in the Class Hall; there is a small daily chance instead you will be phased to Frostfire Ridge where you can loot Everburning Crystal. You will be alerted to this chance by an emote when walking around on the stairs of your class hall.",g={h(-424,{c=a[949],isDaily=1,questID=44384}),n(113513,{c=a[949],description="If this quest has a checkmark next to it, then that means the scenario portal is active. He only appears in a special phase in Frostfire Ridge upon taking the portal.",sourceQuests={44384},g={i(139560,{b=1,c=a[949],f=55,spellID=220691,g={artifact(180,{c=a[949]})}})}})}})}})}}),h(-33,{c=a[949],collectible=false,u=5,g={follower(769,{c=a[949],collectible=false,u=5}),follower(817,{c=a[949],collectible=false,u=5}),follower(818,{c=a[949],collectible=false,u=5}),follower(819,{c=a[949],collectible=false,u=5}),follower(1004,{c=a[949],collectible=false,u=5}),follower(1005,{c=a[949],collectible=false,u=5}),follower(1006,{c=a[949],collectible=false,u=5}),follower(1007,{c=a[949],collectible=false,u=5}),follower(768,{c=a[949],collectible=false,u=5}),follower(823,{c=a[949],collectible=false,u=5}),follower(824,{c=a[949],collectible=false,u=5}),follower(825,{c=a[949],collectible=false,u=5}),follower(659,{c=a[949],collectible=false,u=5}),follower(820,{c=a[949],